import React from 'react';
import { Link  } from 'react-route-dom';

const Header = () => {
    return (
        <header>
            <h1>Create, Read, Update, Delete for Car API!</h1>
            <nav>
                <Link to={'/'}>Home: Documentation Page</Link>
                <Link to={'/carshoppingapi'}>Car API page</Link>
            </nav>
        </header>
    )
}
